INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('6955632901932', 'Qu Wei Long Jing Green Tea', 'G 龙井是中国十大名茶之一,向以“色绿、 香郁、味甘、形美”四绝著称,古人有 “甘 香如兰,幽而不河,啜之淡然,看似以无味,而 饮后感太和之气弥漫齿额之间,此无味之味, 乃至味也” 之赞语。品尝龙井茶可谓说是一 种艺术享受,不是画而胜于赏画,不是诗而胜 于吟诗。 最佳冲泡方式:以沸水烫温容量为200毫升 的玻璃或瓷器茶具后,置入5克的茶量于壶中约 1/6满,冲入约85度开水,第一泡20秒,第二泡 10秒,第三泡20秒,后续每泡累加5-10秒,浓度 可依个人喜好酌量增减冲泡时间。 浙江天福茶业有限公司出品 地址:中国浙江省新昌县梅渚镇省级高新 技术产业 园区内 电话:+86(575)86336280 传真:+86(575)86336281 事编:312532 网址: www. TENFU. com 邮箱te fu@tenfu. 客服車电精十&r592)3257991 IT', 'https://static.openfoodfacts.org/images/products/695/563/290/1932/front_en.3.400.jpg', '', '', '', '', '', '', '', '', '', '1');

